  false,\n\t\"url\": null,\n\t\"notes\": \"A large body of scientific study over the
  last thirty years has resulted in ever increasing appreciation of the value of marshes
  and other wetlands as valuable natural resources. This study details investigations
  made by the University of Maryland in 1979-1981 into a number of these processes
  identified as possible factors in the disappearance of brackish tidal marshlands
  in Dorchester County, Maryland. The primary objectives of this study were 1) To
  determine the causes of marsh loss at Blackwater National Wildlife Refuge 2) To
  make recommendations based on the findings for proper management practices.\",\n\t\"license_title\":
